def get_rowrules(self, M):
    """
    get_rowrules returns the rules that make sure no duplicates can
    be in one row.
    """
    rowrule = []
    for row in np.arange(1,M+1,1):
        for val in np.arange(1,M+1,1):
            for col in np.arange(1,M+1,1):
                rowrule.append(-((row*100)+(col*10)+(val)),)
                for j in np.arange(1,M+1,1):
                    if j == col:
                        continue
                    rowrule.append(((row*100)+(j*10)+(val)))
    return rowrule
